import React from "react";
import "./style.css";
import { Jumbotron, Container } from "react-bootstrap";
import headImage from "../../img/index_header.webp";

function Home() {
    return (
        <Jumbotron fluid style={{ backgroundImage: `url(${headImage})`, backgroundSize: 'cover', height: '450px' }}>
            <Container>
                <h2>Kids teaching kids to lead the way in protecting the world's oceans</h2>
            </Container>
        </Jumbotron>
    )
}

export default Home;
